import React, { Component } from 'react';

import Picture from '../images/profile.jpg';

import ResizeImage from 'react-resize-image';

class ProfileImage extends Component {
    render() {
        return (
            <ResizeImage 
            src={Picture}
            alt="Profile Image"
            options= {{
                width: "200px",
            }}/>
        )
    }
}

export default ProfileImage;
